sys_variable_value.value:
(function execute(inputs, outputs) {
    // Create GlideRecord for employee table
    var emp = new GlideRecord('x_1745159_growhive_employees');

    // Filter employees by matching department (case-insensitive)
    emp.addEncodedQuery('emp_departmentLIKE' + inputs.department); 
    emp.orderBy('current_load'); // Sort by least load
    emp.setLimit(1); // Only one record needed
    emp.query();

    if (emp.next()) {
        outputs.employeeSysId = emp.getUniqueValue();
        outputs.currentLoad = parseInt(emp.getValue('current_load'), 10);
        outputs.employeeName = emp.getValue('name'); // You can also use getDisplayValue()
    } else {
        outputs.employeeSysId = '';
        outputs.currentLoad = 0;
        outputs.employeeName = 'No employee found';
    }
})(inputs, outputs);

